import styled from "styled-components";

export const ErrorContainer = styled.div`
    background-color: blue;
    width: 100%;
    height: 100vh;
    align-items: center;
    margin: 0;
    padding: 0;
`

export const Title = styled.div`
    align-items: center;
`
